  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100063 includes chemical,
  discrete bottle, physical and time series data collected from ARNI FRIDRIKSSON and
  BJARNI SAEMUNDSSON in the Iceland Sea from 1991-08-15 to 2006-10-02 and retrieved
  during cruise CARINA_Iceland_Sea Time Series. These data include CARBON DIOXIDE
  - PARTIAL PRESSURE (pCO2), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, NITRATE,
  PHOSPHATE, SALINITY, SILICATE and TEMPERATURE. The instruments used to collect these
  data include bottle. These data were collected by J. Olafsson of ICELANDIC MARINE
  RESEARCH INSTITUTE as part of the CARINA_Iceland_Sea Time Series data set.\",\n\t\"owner_org\":
